dfs = []
for pump_id in day_data['id'].unique():
    pump_df = day_data[day_data['id'] == pump_id].reset_index(drop=True)
    shape = pump_df.shape[0]
    top_x = round(shape * X_percent / 100)
    zeros = pump_df.iloc[:top_x, :].reset_index(drop=True)
    ones = pump_df.iloc[-BOTTOM_AMOUNT:, :].reset_index(drop=True)
    zeros['target'] = 0
    ones['target'] = 1
    pump_filtered = pd.concat([zeros, ones], axis=0)
