X_train_scaled = std_scaler.fit_transform(X_train)
model = keras.Sequential([
    keras.layers.Dense(1, input_shape=(X_train_scaled.shape[1],), activation='sigmoid')
])  
model.compile(optimizer='sgd', loss='binary_crossentropy', metrics=['binary_accuracy'])

model.fit(
    x=X_train_scaled,
    y=y_train,
    shuffle=True,
    epochs=32,
    batch_size=16,
    class_weight={0:1, 1:17}
)
K.set_value(model.optimizer.learning_rate, 0.01)

for pump in day_data['id'].unique():
    pump_test_data = test_by_day_data[day_data['id'] == pump].reset_index(drop=True)
    scaled_pump_test_data = std_scaler.fit_transform(pump_test_data)
    predictions = model.predict_proba(scaled_pump_test_data, batch_size=10000)
    plt.plot(np.arange(predictions.shape[0]), predictions)
    plt.title(pump)
    plt.ylabel('Probability')
    plt.xlabel('Day since start')
    plt.show()

